    public static void dumpMemory(String item, byte [] buf) {

        int lines = buf.length % 8 == 0 ? buf.length/8 : buf.length/8 + 1;
        int j = 0;
        int k = 0;
        int i = 0;
        byte c ;
        int WID = 16;
        System.out.println(item + "--" + buf.length);
        while(j*WID < buf.length){
            System.out.printf(" %04X: ", j*WID);
            for(i = 0; i < WID; i++){
                if((i + j * WID)>=buf.length) break;
                c = buf[i + j * WID];
                System.out.printf("%02X ",c);
                if((i+1) % 8 == 0) System.out.print(" ");
            }

            for(k=i; k<WID; k++){
                System.out.printf(" ");
                if((k+1) % 8 == 0) System.out.printf(" ");
            }
            System.out.printf(" ");

            for(i=0; i<WID; i++){
                if((i+j*WID) >= buf.length) break;
                c = buf[i+j*WID];
                if(c >= 0x30 && c <= 0x7a){
                    System.out.printf("%c",c);
                }else{
                    System.out.printf("%c",'.');
                }
            }
            System.out.printf("\n");
            j++;
        }
    }
    public static String BytesToStr(byte[] target) {
        StringBuffer buf = new StringBuffer();
        for (int i = 0, j = target.length; i < j; i++) {
            buf.append((char) target[i]);
        }
        return buf.toString();
    }
    public static byte[] StrToBytes(String str) {
        byte[] buf = new byte[str.length()];
        for (int i = 0; i < str.length(); i++) {
            buf[i] = (byte) str.charAt(i);
        }
        return buf;
    }
