    public static byte[] Txt2Hex(String Str){
        byte[] data = Str.toLowerCase().getBytes();
        byte[] redata = new byte[(data.length/2)];
        for(int i=0;i<data.length;i+=2){
            if(data[i]>=(byte)97){
                switch(data[i]){
                    case 97:
                        data[i] = (byte)58;
                        break;
                    case 98:
                        data[i] = (byte)59;
                        break;
                    case 99:
                        data[i] = (byte)60;
                        break;
                    case 100:
                        data[i] = (byte)61;
                        break;
                    case 101:
                        data[i] = (byte)62;
                        break;
                    case 102:
                        data[i] = (byte)63;
                        break;
                }
            }
            if(data[i+1]>=(byte)97){
                switch(data[i+1]){
                    case 97:
                        data[i+1] = (byte)58;
                        break;
                    case 98:
                        data[i+1] = (byte)59;
                        break;
                    case 99:
                        data[i+1] = (byte)60;
                        break;
                    case 100:
                        data[i+1] = (byte)61;
                        break;
                    case 101:
                        data[i+1] = (byte)62;
                        break;
                    case 102:
                        data[i+1] = (byte)63;
                        break;
                }
            }
            redata[i/2] =(byte)(((data[i]-48)*16)+data[i+1]-48);
        }
        return redata;
    }

